import React, { useState } from "react";

const OperationStep = ({ formData, setFormData }) => {
  const [customOrg, setCustomOrg] = useState("");

  const handleOrgChange = (e) => {
    const { value } = e.target;
    if (value === "Others") {
      setFormData({ ...formData, organizationRegistration: customOrg });
    } else {
      setFormData({ ...formData, organizationRegistration: value });
      setCustomOrg(""); // Reset custom input when switching back
    }
  };

  const handleCustomOrgChange = (e) => {
    setCustomOrg(e.target.value);
    setFormData({ ...formData, organizationRegistration: e.target.value });
  };

  return (
    <div>
      <h2>Step 2: Operation Details</h2>

      {/* Organization Registration */}
      <label>Organization Registration:</label>
      <select value={formData.organizationRegistration} onChange={handleOrgChange} required>
        <option value="">Select</option>
        <option value="Cooperative">Cooperative</option>
        <option value="Stock Corporation">Stock Corporation</option>
        <option value="Non-stock Corporation">Non-stock Corporation</option>
        <option value="Unregistered">Unregistered</option>
        <option value="Others">Others</option>
      </select>

      {/* Show custom text input only if "Others" is selected */}
      {formData.organizationRegistration === customOrg && (
        <input
          type="text"
          value={customOrg}
          onChange={handleCustomOrgChange}
          placeholder="Enter organization type"
          required
        />
      )}

      {/* Date Established */}
      <label>Date Established:</label>
      <input
        type="date"
        value={formData.dateEstablished}
        onChange={(e) => setFormData({ ...formData, dateEstablished: e.target.value })}
        required
      />

      {/* Target Members */}
      <label>Target Members:</label>
      <input
        type="text"
        value={formData.targetMembers}
        onChange={(e) => setFormData({ ...formData, targetMembers: e.target.value })}
      />

      {/* Number of Members */}
      <label>Number of Members:</label>
      <input
        type="number"
        placeholder="Male"
        value={formData.numberOfMembers?.male || ""}
        onChange={(e) =>
          setFormData({ ...formData, numberOfMembers: { ...formData.numberOfMembers, male: e.target.value } })
        }
      />
      <input
        type="number"
        placeholder="Female"
        value={formData.numberOfMembers?.female || ""}
        onChange={(e) =>
          setFormData({ ...formData, numberOfMembers: { ...formData.numberOfMembers, female: e.target.value } })
        }
      />

      {/* Experience in Procurement */}
      <label>Experience in Procurement:</label>
      <div>
        {["Competitive Bidding", "Negotiated Procurement", "Shopping", "Small Value Procurement", "No Experience"].map((method) => (
          <div key={method}>
            <input
              type="checkbox"
              value={method}
              onChange={(e) => {
                const { checked, value } = e.target;
                if (checked) {
                  setFormData({
                    ...formData,
                    procurement_experience: [
                      ...formData.procurement_experience,
                      { method: value, participation_count: 0, contracts_won: 0, successful_implementations: 0 },
                    ],
                  });
                } else {
                  setFormData({
                    ...formData,
                    procurement_experience: formData.procurement_experience.filter((item) => item.method !== value),
                  });
                }
              }}
            />
            <label>{method}</label>
          </div>
        ))}
      </div>

      {formData.procurement_experience.map((exp, index) => (
        <div key={index}>
          <h4>{exp.method}</h4>
          <label>Number of Participation:</label>
          <input
            type="number"
            value={exp.participation_count}
            onChange={(e) => {
              const updatedExperience = [...formData.procurement_experience];
              updatedExperience[index].participation_count = parseInt(e.target.value, 10) || 0;
              setFormData({ ...formData, procurement_experience: updatedExperience });
            }}
          />
          <label>Number of Contracts Won:</label>
          <input
            type="number"
            value={exp.contracts_won}
            onChange={(e) => {
              const updatedExperience = [...formData.procurement_experience];
              updatedExperience[index].contracts_won = parseInt(e.target.value, 10) || 0;
              setFormData({ ...formData, procurement_experience: updatedExperience });
            }}
          />
          <label>Number of Successful Implementations:</label>
          <input
            type="number"
            value={exp.successful_implementations}
            onChange={(e) => {
              const updatedExperience = [...formData.procurement_experience];
              updatedExperience[index].successful_implementations = parseInt(e.target.value, 10) || 0;
              setFormData({ ...formData, procurement_experience: updatedExperience });
            }}
          />
        </div>
      ))}

      {/* Sponsor Agency */}
      <label>Sponsor Agency:</label>
      <input
        type="text"
        value={formData.sponsor_agency}
        onChange={(e) => setFormData({ ...formData, sponsor_agency: e.target.value })}
        required
      />

      <label>Other Sponsor Agency (Optional):</label>
      <input
        type="text"
        value={formData.other_sponsor_agency}
        onChange={(e) => setFormData({ ...formData, other_sponsor_agency: e.target.value })}
      />
    </div>
  );
};

export default OperationStep;
